import { initializeApp } from "firebase/app";
import { getDatabase } from "firebase/database";
import { getAuth } from "firebase/auth";

var firebaseConfig = {
    apiKey: "AIzaSyDMegvseb3-io9m9cdPl51SsLNBfAfhHYU",
    authDomain: "myersparkibwebsite-cb3ea.firebaseapp.com",
    projectId: "myersparkibwebsite-cb3ea",
    storageBucket: "myersparkibwebsite-cb3ea.appspot.com",
    messagingSenderId: "681954041704",
    appId: "1:681954041704:web:1dad5cc8f0bf158f37c0dd",
    measurementId: "G-P950E6M3J0"
};

var firebaseConfig = {
    apiKey: process.env.REACT_APP_API_KEY,
    authDomain: process.env.REACT_APP_AUTH_DOMAIN,
    projectId: process.env.REACT_APP_PROJECT_ID,
    storageBucket: process.env.REACT_APP_STORAGE_BUCKET,
    messagingSenderId: process.env.REACT_APP_MESSAGING_SENDER_ID,
    appId: process.env.REACT_APP_APP_ID,
    measurementId: process.env.REACT_APP_MEASUREMENT_ID
};
const app = initializeApp(firebaseConfig);
export const auth = getAuth(app);
export const db = getDatabase(app);
export default app;
